import React from 'react';
import './LoginPage.css';
import { useNavigate } from 'react-router-dom';

function LoginPage() {
  const navigate = useNavigate();

  const goBack = () => {
    navigate(-1); // 이전 페이지로 이동
  };
  return (
    <div className = "login">
      <div className = 'title'>
        Log In
      </div>
      <button onClick={goBack}>
        <a href="https://www.flaticon.com/kr/free-icons/-" title="뒤로 화살표 아이콘">
        </a><img src="public/images/backbutton.png" alt="뒤로가기버튼"/>
      </button>
    </div>
  );
}

export default LoginPage;
